<template>
  <div class="para-scroll">
    <div class="content-item">内容1</div>
    <div class="active-bg common-bg" id="pic1" :style="firstBgStyle"></div>
    <div class="content-item">内容2</div>
    <div class="active-bg common-bg" id="pic2" :style="secondBgStyle"></div>
    <div class="content-item">内容3</div>
    <div class="active-bg common-bg" id="pic3" :style="thirdBgStyle"></div>
    <div class="content-item">内容4</div>
  </div>
</template>
<script>
/**
 * 视差滚动学习样例
 */
export default {
  name: 'paraScroll',
  data () {
    return {
      ratio: 0.2,
      positionY1: 0,
      positionY2: 0,
      positionY3: 0,
      Y1: 0,
      Y2: 0,
      Y3: 0
    }
  },
  components: {},
  mounted () {
    window.addEventListener('scroll', this.handleScroll)
    let pic1 = document.getElementById('pic1')
    let pic2 = document.getElementById('pic2')
    let pic3 = document.getElementById('pic3')
    this.positionY1 = this.Y1 = Math.floor(pic1.offsetTop * this.ratio)
    this.positionY2 = this.Y2 = Math.floor(pic2.offsetTop * this.ratio)
    this.positionY3 = this.Y3 = Math.floor(pic3.offsetTop * this.ratio)
    console.log(this.Y1, this.Y2, this.Y3)
  },
  methods: {
    handleScroll () {
      let scrollTop =
        window.pageYOffset ||
        document.documentElement.scrollTop ||
        document.body.scrollTop
      let offset = (scrollTop + 1000) * this.ratio
      this.positionY1 = this.Y1 - offset
      this.positionY2 = this.Y2 - offset
      this.positionY3 = this.Y3 - offset
    }
  },
  computed: {
    firstBgStyle () {
      return {
        'background-position-x': '50%',
        'background-position-y': this.positionY1 + 'px'
      }
    },
    secondBgStyle () {
      return {
        'background-position-x': '50%',
        'background-position-y': this.positionY2 + 'px'
      }
    },
    thirdBgStyle () {
      return {
        'background-position-x': '50%',
        'background-position-y': this.positionY3 + 'px'
      }
    }
  }
}
</script>
